import {DataManager} from "../framework/dataManager/DataManager.js"

let loglevel = "exception"

let machineSchema = {
    "name": "Machine",
    "type": "object",
    "properties": {
        "name": {"type": "string"},
        "start": {
            "type": "object", 
            "$ref": "#/definitions/State"
        }
    },
    "relations": {
        "oneToMany": [
            {
                "$ref": "#/definitions/State", 
                "referrer": "states", 
                "referred": "machine"
            }
        ]
    },
    "definitions": {
        "State": {
            "properties": {
                "name": {"type": "string"}
            },
            "relations": {
                "oneToMany": [
                    {
                        "$ref": "#/definitions/Transition", 
                        "referrer": "transitions_in", 
                        "referred": "to"
                    },
                    {
                        "$ref": "#/definitions/Transition", 
                        "referrer": "transitions_out", 
                        "referred": "from"
                    }
                ]
            }
        },
        "Transition": {
            "properties": {
                "events": {
                    "type": "array",
                    "items": {"type": "string"}
                }
            }
        }
    }
}

let Logging = (superclass) => class extends superclass {
    constructor(schema, kwargs) {
        super(schema, kwargs);
        let available_loglevels = {
            "debug": 0,
            "info": 1,
            "exception": 2,
            "none": 3
        }
        if("loglevel" in kwargs && kwargs.loglevel in available_loglevels) {
            this.loglevel = available_loglevels[loglevel]
        } else {
            this.loglevel = available_loglevels["exception"]
        }
        this.properties_to_log = "properties_to_log" in kwargs ? kwargs.properties_to_log : {}
        console.log(this.properties_to_log)
        this.methodsWithSideEffects = ["push", "splice", "pop", "shift", "unshift"]
    }

    set(propKey, value) {
        let result
        try {
            result = super.set(propKey, value)
            if(this.loglevel < 2) {
                console.log(`event 'set' on property '${propKey}' of ${this.toString()} with value`, String(value))
            }
        } catch (err) {
            if(this.loglevel < 3) {
                console.log(`exception occurred for property '${propKey}' in ${this.toString()}: "`, err.message, '"')
                console.log(err.stack)
            }
            throw err
        }
        return result
    }

    afterArray(method, property, array) {
        super.afterArray(method, property, array)
        if(this.loglevel < 2 && this.methodsWithSideEffects.includes(method)) {
            console.log(`event '${method}' on property '${property}' in ${this.toString()}`)
        }
    }

    arrayError(method, property, error, args) {
        try {
            super.arrayError(method, property, error, args)
        } catch (err) {
            if(this.loglevel < 3) {
                console.log(`exception occurred for property '${property}' in <${this.toString()}: "`, err.message, '"')
                console.log(e.stack)
            }
            throw err
        }
    }

    toString() {
        return this.loglevel == 0 ? this.valuesToString().replace('\\', '') : super.toString()
    }

    [Symbol.toPrimitive]() {
        return super.toString()
    }
}

let Locking = (superclass) => class extends superclass {
    constructor(schema, kwargs) {
        super(schema, kwargs);
        this.methodsWithSideEffects = ["push", "splice", "pop", "shift", "unshift"]
        this.locked = false;
    }

    set(propKey, value) {
        if(this.locked) {
            throw new TypeError("object is locked");
        }
        return super.set(propKey, value);
    }

    lock() {
        this.locked = true;
    }

    unlock() {
        this.locked = false;
    }

    beforeArray(property, args, array) {
        args = super.beforeArray(property, args, array)        
        if(this.locked  && this.methodsWithSideEffects.includes(property)) {
            throw TypeError("object is locked")
        }
        return args
    }
}


function makeDoors(manager) {
    let doors = new manager.Machine({"name": "doors"}, {"properties_to_log": ["name", "start", "states"]})

    let stateOpened = new manager.State({"name": "opened"})
    let stateClosed = new manager.State({"name": "closed"})
    let stateLocked = new manager.State({"name": "locked"})

    doors.start = stateClosed;
    doors.states.push(stateOpened, stateClosed, stateLocked)

    let transOpen = new manager.Transition({"events": ["open"]})  
    let transClose = new manager.Transition({"events": ["close"]})
    let transLock = new manager.Transition({"events": ["lock"]})
    let transUnlock = new manager.Transition({"events": ["unlock"]})

    stateOpened.transitions_in.push(transOpen)
    stateOpened.transitions_out.push(transClose)

    stateClosed.transitions_in.push(transClose, transUnlock)
    stateClosed.transitions_out.push(transOpen, transLock)

    stateLocked.transitions_in.push(transLock)
    stateLocked.transitions_out.push(transUnlock)

    return doors
}

function execute(machine, events) {
    let errorCnt = 0
    let executionLog = []

    events.map((event) => {
        let transition = machine.start.transitions_out.map((transition) => {
            return {
                success: transition.events.includes(event),
                from: transition.from,
                to: transition.to
            }
        }).reduce((acc, item) => {
            return item.success ? item : acc
        }, {success: false, from: machine.start})
        if(transition.success) {
            try {
                machine.start = transition.to
                executionLog.push("Executed transition from "+transition.from.name+" to "+transition.to.name+" with event "+event)
            } catch(e) {
                errorCnt++
                executionLog.push("An exception occurred while executing transition from "+transition.from.name+" to "+transition.to.name+" with event "+event)
            }
        } else {
            errorCnt++
            executionLog.push("State "+transition.from.name+" has no outgoing transitions with event "+event)
        }
    })
    return {
        errorCnt,
        executionLog: executionLog.join("\n")
    }
}

